// src/App.jsx
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Sidebar from './components/Sidebar'; // Sidebar component
import Dashboard from './components/Dashboard'; // Dashboard component
import ShopPerformance from './components/ShopPerformance'; // ShopPerformance component (mock for now)
import CreatorPerformance from './components/CreatorPerformance'; // CreatorPerformance component (mock for now)

import './App.css'; // Import the new CSS file
import TikTokLogin from './components/TikTokLogin';

const App = () => {
  return (
    <Router>
      <div className="app-container">
        <Routes>
          <Route path="/" element={<Dashboard />} />
          <Route path="/shop-performance" element={<ShopPerformance />} />
          <Route path="/creator-performance" element={<CreatorPerformance />} />
          <Route path="/login" element={<TikTokLogin />} /> {/* Add route for LoginPage */}
        </Routes>
      </div>
    </Router>
  );
};

export default App;
